import {Text, View} from 'react-native';
import {useNavigation} from '@react-navigation/native'; 
import { Button, IconButton } from "react-native-paper";

export default function User(props){
    //navigation
    const navigation = useNavigation(); 
    let u = props.user.item; 
    return (
        <View>
            <View>
                <Text>{u.firstName} {u.lastName}</Text>
            </View>
            <View>
                <IconButton icon="account-details" size={28} color="#941a1d" activeOpacity={0.5} onPress={()=>navigation.navigate("Details",u)}>
                    <Text >Details</Text>
                </IconButton>
                <IconButton icon="edit" size={28} color="#941a1d" activeOpacity={0.5} onPress={()=>navigation.navigate("Edit",u)}>
                    <Text>Edit</Text>
                </IconButton>
                <IconButton icon="delete" size={28} color="#941a1d" activeOpacity={0.5} onPress={()=>navigation.navigate("Delete",u)}>
                    <Text>Delete</Text>
                </IconButton>
            </View>      
        </View>
    ); 
}
